import React from 'react';
import './App.css';

function Navbar() {
    return(
        <div className = 'Navbar'>
            <p>
            <h1>Mobolaji Rotibi</h1>
            <h2>Projects</h2>
            <h2>Resume</h2>
            </p>
        </div>
    );
};

export default Navbar;
